本物のカーボンを採用しながら由にカットの出来き、曲面にも貼れるマジカルカーボン。リアルカーボンならではの質感は他製品を圧倒します。リアエンブレムにフィットするようにカット済みで貼り付けるだけで施工できます。 <br><br>ハセプロ独自の特殊加工を施している為カット面が毛羽立たず 、カーボン繊維に沿って伸ばす事が出きるのである程度の曲面等に貼り付ける事が可能でキレイな仕上がりが可能となります。また、対候性にも優れており、耐候５年、ヒートサイクル℃１３０度からー３０度を５回転させて劣化や剥がれ等のテストにも合格してます。<br><br>■カラー：マットブラック ■入数：カーボンシート1枚（エンブレムは含まれません） ※マジカルカーボンは特許番号3785212号取得した高品質カーボンシートです。類似品・粗悪品にご注意ください。対応車種：NCP50系 サクシード(2002/7～) <br><br>車検対応品<br><br>ボディパーツ/エンブレム<BR>※こちらの商品は代金引き換え不可となっております。ご了承ください。<tr><td colspan="2">
